            return (this.X != s && this.Y != s);
        }

        /// <summary>
        /// Returns whether a is Different ALL elements of v.
        /// ATTENTION: For example (AllSmaller(a,b)) is not the same as !(AllGreaterOrEqual(a,b)) but !(AnyGreaterOrEqual(a,b)).
        /// </summary>
        public static bool AllDifferent(int s, V2i v)
        {
            return (s != v.X && s != v.Y);
        }

        /// <summary>
        /// Returns whether AT LEAST ONE element of a is Different the corresponding element of b.
        /// ATTENTION: For example (AllSmaller(a,b)) is not the same as !(AllGreaterOrEqual(a,b)) but !(AnyGreaterOrEqual(a,b)).
        /// </summary>
        public static bool AnyDifferent(V2i a, V2i b)
        {
            return (a.X != b.X || a.Y != b.Y);
        }

        /// <summary>
        /// Returns whether AT LEAST ONE element of a is Different the corresponding element of b.
        /// ATTENTION: For example (a.AllSmaller(b)) is not the same as !(a.AllGreaterOrEqual(b)) but !(a.AnyGreaterOrEqual(b)).
        /// </summary>
        public bool AnyDifferent(V2i v)
        {
            return (this.X != v.X || this.Y != v.Y);
        }

        /// <summary>
        /// Returns whether AT LEAST ONE element of v is Different s.
        /// ATTENTION: For example (AllSmaller(a,b)) is not the same as !(AllGreaterOrEqual(a,b)) but !(AnyGreaterOrEqual(a,b)).
        /// </summary>
        public static bool AnyDifferent(V2i v, int s)
        {
            return (v.X != s || v.Y != s);
        }

        /// <summary>
        /// Returns whether AT LEAST ONE element of v is Different s.
        /// ATTENTION: For example (AllSmaller(a,b)) is not the same as !(AllGreaterOrEqual(a,b)) but !(AnyGreaterOrEqual(a,b)).
        /// </summary>
        public bool AnyDifferent(int s)
        {
            return (this.X != s || this.Y != s);
        }

        /// <summary>
        /// Returns whether a is Different AT LEAST ONE element of v.
        /// ATTENTION: For example (AllSmaller(a,b)) is not the same as !(AllGreaterOrEqual(a,b)) but !(AnyGreaterOrEqual(a,b)).
        /// </summary>
        public static bool AnyDifferent(int s, V2i v)
        {
            return (s != v.X || s != v.Y);
        }

        /// <summary>
        /// Returns the componentwise minimum vector.
        /// </summary>
        public static V2i Min(V2i v0, V2i v1)
        {
            return new V2i(Fun.Min(v0.X, v1.X), Fun.Min(v0.Y, v1.Y));
        }

        /// <summary>
        /// Returns the componentwise maximum vector.
        /// </summary>
        public static V2i Max(V2i v0, V2i v1)
        {
            return new V2i(Fun.Max(v0.X, v1.X), Fun.Max(v0.Y, v1.Y));
        }

        /// <summary>
        /// Compare x-coordinate before y-coordinate, aso.
        /// </summary>
        public static int LexicalCompare(V2i v0, V2i v1)
        {
            if (v0.X < v1.X) return -1;
            if (v0.X > v1.X) return +1;
            if (v0.Y < v1.Y) return -1;
            if (v0.Y > v1.Y) return +1;
            return 0;
        }

        /// <summary>
        /// Compare x-coordinate before y-coordinate, aso.
        /// </summary>
        public int LexicalCompare(V2i v1)
        {
            if (X < v1.X) return -1;
            if (X > v1.X) return +1;
            if (Y < v1.Y) return -1;
            if (Y > v1.Y) return +1;
            return 0;
        }

