        #region IEquatable<V2i> Members

        public bool Equals(V2i other)
        {
            return X == other.X && Y == other.Y;
        }

        #endregion

        #region Overrides

        public override string ToString()
        {
            return ToString(null, Localization.FormatEnUS);
        }
        
        public string ToString(string format)
        {
            return ToString(format, Localization.FormatEnUS);
        }

        public string ToString(string format, IFormatProvider fp)
        {
            return ToString(format, fp, "[", ", ", "]");
        }

        /// <summary>
        /// Outputs e.g. a 3D-Vector in the form "(begin)x(between)y(between)z(end)".
        /// </summary>
        public string ToString(string format, IFormatProvider fp, string begin, string between, string end)
        {
            if (fp == null) fp = Localization.FormatEnUS;
            return begin + X.ToString(format, fp)  + between + Y.ToString(format, fp)  + end;
        }

        public override int GetHashCode()
        {
            return HashCode.GetCombined(X, Y); 
        }
        
        public override bool Equals(object other)
        {
            return (other is V2i) ? this == (V2i)other : false;
        }

        public Text ToText(int bracketLevel = 1)
        {
            return
                ((bracketLevel == 1 ? "[" : "")
                + X.ToString(null, Localization.FormatEnUS)  + ", " 
                + Y.ToString(null, Localization.FormatEnUS) 
                + (bracketLevel == 1 ? "]" : "")).ToText();
        }

        #endregion

        #region Parsing

        public static V2i Parse(string s)
        {
            var x = s.NestedBracketSplitLevelOne().ToArray();
            return new V2i(
                int.Parse(x[0], Localization.FormatEnUS), 
                int.Parse(x[1], Localization.FormatEnUS)
            );
        }

        public static V2i Parse(Text t)
        {
            return t.NestedBracketSplit(1, Text<int>.Parse, V2i.Setter);
        }

        public static V2i Parse(Text t, int bracketLevel)
        {
            return t.NestedBracketSplit(bracketLevel, Text<int>.Parse, V2i.Setter);
        }

        #endregion

