        #region IVector<double> Members

        /// <summary>
        /// By using long indices, the IVector&lt;double&gt; interface is
        /// accessed.
        /// </summary>
        public double this[long i]
        {
            get { return (double)this[(int)i]; }
            set { this[(int)i] = (int)value; }
        }

        #endregion

        #region ISize2d Members

        public V2d Size2d { get { return (V2d)this; } }

        #endregion

        #region IVector

        public long Dim
        {
            get { return 2; }
        }

        public object GetValue(long index)
        {
            return (object)this[(int)index];
        }

        public void SetValue(object value, long index)
        {
            this[(int)index] = (int)value;
        }

        #endregion

    }

    public class V2iEqualityComparer : IEqualityComparer<V2i>
    {
        public static readonly V2iEqualityComparer Default
            = new V2iEqualityComparer();

        #region IEqualityComparer<V2i> Members

        public bool Equals(V2i v0, V2i v1)
        {
            return v0 == v1;
        }

        public int GetHashCode(V2i v)
        {
            return v.GetHashCode();
        }

        #endregion
    }

    /// <summary>
    /// This static class for extension functions for V2i has a non-
    /// standard name ending in "Fun" in order to shorten the function name
    /// when used as function parameters.
    /// </summary>
    public static partial class VecFun
    {
        #region Elementwise Extrema

        /// <summary>
        /// Returns element-wise minimum of given vectors.
        /// </summary>
        public static V2i Min(V2i v0, V2i v1)
        {
            return new V2i(
                        Fun.Min(v0.X, v1.X), 
                        Fun.Min(v0.Y, v1.Y));
        }

        /// <summary>
        /// Returns element-wise minimum of given vectors.
        /// </summary>
        public static V2i Max(V2i v0, V2i v1)
        {
            return new V2i(
                        Fun.Max(v0.X, v1.X), 
                        Fun.Max(v0.Y, v1.Y));
        }

        /// <summary>
        /// Returns element-wise minimum of given vectors.
        /// </summary>
        public static V2i Min(V2i v0, V2i v1, V2i v2)
        {
            return new V2i(
                        Fun.Min(v0.X, v1.X, v2.X), 
                        Fun.Min(v0.Y, v1.Y, v2.Y));
        }

        /// <summary>
        /// Returns element-wise minimum of given vectors.
        /// </summary>
        public static V2i Max(V2i v0, V2i v1, V2i v2)
        {
            return new V2i(
                        Fun.Max(v0.X, v1.X, v2.X), 
                        Fun.Max(v0.Y, v1.Y, v2.Y));
        }

        /// <summary>
        /// Returns element-wise minimum of given vectors.
        /// </summary>
        public static V2i Min(V2i v0, V2i v1, V2i v2, V2i v3)
        {
            return new V2i(
                        Fun.Min(v0.X, v1.X, v2.X, v3.X), 
                        Fun.Min(v0.Y, v1.Y, v2.Y, v3.Y));
        }

        /// <summary>
        /// Returns element-wise minimum of given vectors.
        /// </summary>
        public static V2i Max(V2i v0, V2i v1, V2i v2, V2i v3)
        {
            return new V2i(
                        Fun.Max(v0.X, v1.X, v2.X, v3.X), 
                        Fun.Max(v0.Y, v1.Y, v2.Y, v3.Y));
        }

        #endregion
        
        #region ArrayExtensions

