            get { return Fun.Sqrt(X * X  + Y * Y ); }
        }
        
        /// <summary>
        /// Returns the Manhattan (or 1-) norm of the vector. This is
        /// calculated as |x| + |y| + ...
        /// </summary>
        public long Norm1
        {
            get { return Fun.Abs(X) + Fun.Abs(Y); }
        }

        /// <summary>
        /// Returns the Euclidean (or 2-) norm of the vector. This is the
        /// length of the vector.
        /// </summary>
        public double Norm2
        {
            get { return Fun.Sqrt(X * X + Y * Y); }
        }

        /// <summary>
        /// Returns the infinite (or maximum) norm of the vector. This is
        /// calculated as max(|x|, |y|, ...).
        /// </summary>
        public long NormMax
        {
            get { return Fun.Max(Fun.Abs(X), Fun.Abs(Y)); }
        }

        /// <summary>
        /// Returns the minimum norm of the vector. This is calculated as
        /// min(|x|, |y|, ...).
        /// </summary>
        public long NormMin
        {
            get { return Fun.Min(Fun.Abs(X), Fun.Abs(Y)); }
        }

        /// <summary>
        /// Gets the p-norm. This is calculated as the p-th root of (|x|^n + |y|^n + ...).
        /// </summary>
        public double Norm(double p)
        {
            return (
                Fun.Abs(X).Pow(p) + 
                Fun.Abs(Y).Pow(p)).Pow(1 / p);
        }

        /// <summary>
        /// Returns the squared distance between the given points.
        /// </summary>
        public static double DistanceSquared(V2l a, V2l b)
        {
            return 
                (b.X - a.X) * (b.X - a.X) + 
                (b.Y - a.Y) * (b.Y - a.Y);
        }

        /// <summary>
        /// Returns the distance between the given points.
        /// </summary>
        public static double Distance(V2l a, V2l b)
        {
            return Fun.Sqrt(
                        (b.X - a.X) * (b.X - a.X) + 
                        (b.Y - a.Y) * (b.Y - a.Y));
        }

        /// <summary>
        /// Returns the Manhatten (or 1-) distance between two vectors.
        /// </summary>
        public static double Distance1(V2l a, V2l b)
        {
            return 
                Fun.Abs(b.X - a.X) + 
                Fun.Abs(b.Y - a.Y);
        }

        /// <summary>
        /// Returns the p-distance between two vectors.
        /// </summary>
        public static double Distance(V2l a, V2l b, double p)
        {
            return (
                        Fun.Abs(b.X - a.X).Pow(p) + 
                        Fun.Abs(b.Y - a.Y).Pow(p)).Pow(1 / p);
        }

        /// <summary>
        /// Returns the maximal absolute distance between the components of
        /// the two vectors.
        /// </summary>
        public static long DistanceMax(V2l a, V2l b)
        {
            return Fun.Max(
                        Fun.Abs(b.X - a.X), 
                        Fun.Abs(b.Y - a.Y));
        }

        /// <summary>
        /// Returns the minimal absolute distance between the components of
        /// the two vectors.
        /// </summary>
        public static long DistanceMin(V2l a, V2l b)
        {
            return Fun.Min(
                        Fun.Abs(b.X - a.X), 
                        Fun.Abs(b.Y - a.Y));
        }

