            var bestDist = V2l.DistanceSquared(point, pointSelector(array[start]));
            int bestIndex = 0;
            for (int i = start + 1, e = start + count; i < e; i++)
            {
                var dist = V2l.DistanceSquared(point, pointSelector(array[i]));
                if (dist < bestDist) { bestDist = dist; bestIndex = i; }
            }
            return bestIndex;
