        }
        
        /// <summary>
        /// Returns the Manhattan (or 1-) norm of the vector. This is
        /// calculated as |x| + |y| + ...
        /// </summary>
        public float Norm1
        {
            get { return Fun.Abs(X) + Fun.Abs(Y); }
        }

        /// <summary>
        /// Returns the Euclidean (or 2-) norm of the vector. This is the
        /// length of the vector.
        /// </summary>
        public float Norm2
        {
            get { return Fun.Sqrt(X * X + Y * Y); }
        }

        /// <summary>
        /// Returns the infinite (or maximum) norm of the vector. This is
        /// calculated as max(|x|, |y|, ...).
        /// </summary>
        public float NormMax
        {
            get { return Fun.Max(Fun.Abs(X), Fun.Abs(Y)); }
        }

        /// <summary>
        /// Returns the minimum norm of the vector. This is calculated as
        /// min(|x|, |y|, ...).
        /// </summary>
        public float NormMin
        {
