        }

        /// <summary>
        /// Gets the p-norm. This is calculated as the p-th root of (|x|^n + |y|^n + ...).
        /// </summary>
        public float Norm(float p)
        {
            return (
                Fun.Abs(X).Pow(p) + 
                Fun.Abs(Y).Pow(p)).Pow(1 / p);
        }

        /// <summary>
        /// Returns the squared distance between the given points.
        /// </summary>
        public static double DistanceSquared(V2f a, V2f b)
        {
            return 
                (b.X - a.X) * (b.X - a.X) + 
                (b.Y - a.Y) * (b.Y - a.Y);
        }

        /// <summary>
        /// Returns the distance between the given points.
        /// </summary>
        public static float Distance(V2f a, V2f b)
        {
            return (float)Fun.Sqrt(
                        (b.X - a.X) * (b.X - a.X) + 
                        (b.Y - a.Y) * (b.Y - a.Y));
        }

        /// <summary>
        /// Returns the Manhatten (or 1-) distance between two vectors.
        /// </summary>
        public static float Distance1(V2f a, V2f b)
        {
            return 
                Fun.Abs(b.X - a.X) + 
                Fun.Abs(b.Y - a.Y);
        }

        /// <summary>
        /// Returns the p-distance between two vectors.
        /// </summary>
        public static float Distance(V2f a, V2f b, float p)
        {
            return (
                        Fun.Abs(b.X - a.X).Pow(p) + 
                        Fun.Abs(b.Y - a.Y).Pow(p)).Pow(1 / p);
        }

        /// <summary>
        /// Returns the maximal absolute distance between the components of
        /// the two vectors.
        /// </summary>
        public static float DistanceMax(V2f a, V2f b)
        {
            return Fun.Max(
                        Fun.Abs(b.X - a.X), 
                        Fun.Abs(b.Y - a.Y));
        }

        /// <summary>
        /// Returns the minimal absolute distance between the components of
        /// the two vectors.
        /// </summary>
        public static float DistanceMin(V2f a, V2f b)
        {
            return Fun.Min(
                        Fun.Abs(b.X - a.X), 
                        Fun.Abs(b.Y - a.Y));
        }

        /// <summary>
        /// Normalizes the vector.
        /// </summary>
        public void Normalize()
        {
            var s = Length; if (s == 0) return;
            s = 1 / s;
            X *= s; Y *= s; 
        }

        /// <summary>
        /// Returns a normalized copy of this vector.
        /// </summary>
        public V2f Normalized
        {
            get
            {
                var s = Length; if (s == 0) return V2f.Zero;
                s = 1 / s;
                return new V2f(X * s, Y * s);
            }
        }

        /// <summary>
        /// Returns a copy of the vector with the maximum component length of
        /// exactly 1. This corresponds to mapping the vector onto an origin-
        /// centered square with side length 2.
        /// </summary>
        public V2f CubeMapped
        {
            get
            {
                float x = Fun.Abs(X);
                float y = Fun.Abs(Y);
                return x > y
                        ? new V2f(Fun.Sign(X), Y / x)
                        : new V2f(X / y, Fun.Sign(Y));
            }
        }

