        /// <summary>
        /// Returns the componentwise minimum vector.
        /// </summary>
        public static V2f Min(V2f v0, V2f v1)
        {
            return new V2f(Fun.Min(v0.X, v1.X), Fun.Min(v0.Y, v1.Y));
        }

        /// <summary>
        /// Returns the componentwise maximum vector.
        /// </summary>
        public static V2f Max(V2f v0, V2f v1)
        {
            return new V2f(Fun.Max(v0.X, v1.X), Fun.Max(v0.Y, v1.Y));
        }

        /// <summary>
        /// Compare x-coordinate before y-coordinate, aso.
        /// </summary>
        public static int LexicalCompare(V2f v0, V2f v1)
        {
            if (v0.X < v1.X) return -1;
            if (v0.X > v1.X) return +1;
            if (v0.Y < v1.Y) return -1;
            if (v0.Y > v1.Y) return +1;
            return 0;
        }

        /// <summary>
        /// Compare x-coordinate before y-coordinate, aso.
        /// </summary>
        public int LexicalCompare(V2f v1)
        {
            if (X < v1.X) return -1;
            if (X > v1.X) return +1;
            if (Y < v1.Y) return -1;
            if (Y > v1.Y) return +1;
            return 0;
        }

