    public class V2fEqualityComparer : IEqualityComparer<V2f>
    {
        public static readonly V2fEqualityComparer Default
            = new V2fEqualityComparer();

        #region IEqualityComparer<V2f> Members

        public bool Equals(V2f v0, V2f v1)
        {
            return v0 == v1;
        }

        public int GetHashCode(V2f v)
        {
            return v.GetHashCode();
        }

        #endregion
    }

    /// <summary>
    /// This static class for extension functions for V2f has a non-
    /// standard name ending in "Fun" in order to shorten the function name
    /// when used as function parameters.
    /// </summary>
    public static partial class VecFun
    {
        #region 2D Vector Arithmetics

        /// <summary>
        /// Dot product of vector with dir rotated by 90 degrees counterclockwise.
        /// </summary>
        public static float Dot90(this V2f v, V2f dir)
        {
            return v.Y * dir.X - v.X * dir.Y;
        }

        /// <summary>
        /// Dot product of vector with dir rotated by 180 degrees.
        /// </summary>
        public static float Dot180(this V2f v, V2f dir)
        {
            return -(v.X * dir.X + v.Y * dir.Y);
        }

        /// <summary>
        /// Dot product of vector with dir rotated by 270 degrees counterclockwise.
        /// </summary>
        public static float Dot270(this V2f v, V2f dir)
        {
            return v.X * dir.Y - v.Y * dir.X;
        }

        /// <summary>
        /// Returns the left value of the direction v with respect to the
        /// line from p0 to p1.
        /// </summary>
        public static float DirLeftOfLineValue(this V2f v, V2f p0, V2f p1)
        {
            return v.X * (p0.Y - p1.Y) + v.Y * (p1.X - p0.X);
        }

        /// <summary>
        /// Returns the right value of the direction v with respect to the
        /// line from p0 to p1.
        /// </summary>
        public static float DirRightOfLineValue(this V2f v, V2f p0, V2f p1)
        {
            return v.X * (p1.Y - p0.Y) + v.Y * (p0.X - p1.X);
        }

        /// <summary>
        /// Returns the left value of the point p with respect to the
        /// line from p0 to p1.
        /// </summary>
        public static float PosLeftOfLineValue(this V2f p, V2f p0, V2f p1)
        {
            return (p.X - p0.X) * (p0.Y - p1.Y) + (p.Y - p0.Y) * (p1.X - p0.X);
        }

        /// <summary>
        /// Returns the right value of the point p with respect to the
        /// line from p0 to p1.
        /// </summary>
        public static float PosRightOfLineValue(this V2f p, V2f p0, V2f p1)
        {
            return (p.X - p0.X) * (p1.Y - p0.Y) + (p.Y - p0.Y) * (p0.X - p1.X);
        }

