        }

        /// <summary>
        /// Gets the p-norm. This is calculated as the p-th root of (|x|^n + |y|^n + ...).
        /// </summary>
        public double Norm(double p)
        {
            return (
                Fun.Abs(X).Pow(p) + 
                Fun.Abs(Y).Pow(p)).Pow(1 / p);
        }

        /// <summary>
        /// Returns the squared distance between the given points.
        /// </summary>
        public static double DistanceSquared(V2d a, V2d b)
        {
            return 
                (b.X - a.X) * (b.X - a.X) + 
                (b.Y - a.Y) * (b.Y - a.Y);
        }

        /// <summary>
        /// Returns the distance between the given points.
        /// </summary>
        public static double Distance(V2d a, V2d b)
        {
            return Fun.Sqrt(
                        (b.X - a.X) * (b.X - a.X) + 
                        (b.Y - a.Y) * (b.Y - a.Y));
        }

        /// <summary>
        /// Returns the Manhatten (or 1-) distance between two vectors.
        /// </summary>
        public static double Distance1(V2d a, V2d b)
        {
            return 
                Fun.Abs(b.X - a.X) + 
                Fun.Abs(b.Y - a.Y);
        }

        /// <summary>
        /// Returns the p-distance between two vectors.
        /// </summary>
        public static double Distance(V2d a, V2d b, double p)
        {
            return (
                        Fun.Abs(b.X - a.X).Pow(p) + 
                        Fun.Abs(b.Y - a.Y).Pow(p)).Pow(1 / p);
        }

        /// <summary>
        /// Returns the maximal absolute distance between the components of
        /// the two vectors.
        /// </summary>
        public static double DistanceMax(V2d a, V2d b)
        {
            return Fun.Max(
                        Fun.Abs(b.X - a.X), 
                        Fun.Abs(b.Y - a.Y));
        }

        /// <summary>
        /// Returns the minimal absolute distance between the components of
        /// the two vectors.
        /// </summary>
        public static double DistanceMin(V2d a, V2d b)
        {
            return Fun.Min(
                        Fun.Abs(b.X - a.X), 
                        Fun.Abs(b.Y - a.Y));
        }

        /// <summary>
        /// Normalizes the vector.
        /// </summary>
        public void Normalize()
        {
            var s = Length; if (s == 0) return;
            s = 1 / s;
            X *= s; Y *= s; 
        }

        /// <summary>
        /// Returns a normalized copy of this vector.
        /// </summary>
        public V2d Normalized
        {
            get
            {
                var s = Length; if (s == 0) return V2d.Zero;
                s = 1 / s;
                return new V2d(X * s, Y * s);
            }
        }

        /// <summary>
        /// Returns a copy of the vector with the maximum component length of
        /// exactly 1. This corresponds to mapping the vector onto an origin-
        /// centered square with side length 2.
        /// </summary>
        public V2d CubeMapped
        {
            get
            {
                double x = Fun.Abs(X);
                double y = Fun.Abs(Y);
                return x > y
                        ? new V2d(Fun.Sign(X), Y / x)
                        : new V2d(X / y, Fun.Sign(Y));
            }
        }

