        #region IVector<double> Members

        /// <summary>
        /// By using long indices, the IVector&lt;double&gt; interface is
        /// accessed.
        /// </summary>
        public double this[long i]
        {
            get { return (double)this[(int)i]; }
            set { this[(int)i] = (double)value; }
        }

        #endregion

        #region ISize2d Members

        public V2d Size2d { get { return (V2d)this; } }

        #endregion

        #region IVector

        public long Dim
        {
            get { return 2; }
        }

        public object GetValue(long index)
        {
            return (object)this[(int)index];
        }

        public void SetValue(object value, long index)
        {
            this[(int)index] = (double)value;
        }

        #endregion

    }

    public class V2dEqualityComparer : IEqualityComparer<V2d>
    {
        public static readonly V2dEqualityComparer Default
            = new V2dEqualityComparer();

        #region IEqualityComparer<V2d> Members

        public bool Equals(V2d v0, V2d v1)
        {
            return v0 == v1;
        }

        public int GetHashCode(V2d v)
        {
            return v.GetHashCode();
        }

        #endregion
    }

    /// <summary>
    /// This static class for extension functions for V2d has a non-
    /// standard name ending in "Fun" in order to shorten the function name
    /// when used as function parameters.
    /// </summary>
    public static partial class VecFun
    {
        #region 2D Vector Arithmetics

        /// <summary>
        /// Dot product of vector with dir rotated by 90 degrees counterclockwise.
        /// </summary>
        public static double Dot90(this V2d v, V2d dir)
        {
            return v.Y * dir.X - v.X * dir.Y;
        }

        /// <summary>
        /// Dot product of vector with dir rotated by 180 degrees.
        /// </summary>
        public static double Dot180(this V2d v, V2d dir)
        {
            return -(v.X * dir.X + v.Y * dir.Y);
        }

        /// <summary>
        /// Dot product of vector with dir rotated by 270 degrees counterclockwise.
        /// </summary>
        public static double Dot270(this V2d v, V2d dir)
        {
            return v.X * dir.Y - v.Y * dir.X;
        }

        /// <summary>
        /// Returns the left value of the direction v with respect to the
        /// line from p0 to p1.
        /// </summary>
        public static double DirLeftOfLineValue(this V2d v, V2d p0, V2d p1)
        {
            return v.X * (p0.Y - p1.Y) + v.Y * (p1.X - p0.X);
        }

        /// <summary>
        /// Returns the right value of the direction v with respect to the
        /// line from p0 to p1.
        /// </summary>
        public static double DirRightOfLineValue(this V2d v, V2d p0, V2d p1)
        {
            return v.X * (p1.Y - p0.Y) + v.Y * (p0.X - p1.X);
        }

        /// <summary>
        /// Returns the left value of the point p with respect to the
        /// line from p0 to p1.
        /// </summary>
        public static double PosLeftOfLineValue(this V2d p, V2d p0, V2d p1)
        {
            return (p.X - p0.X) * (p0.Y - p1.Y) + (p.Y - p0.Y) * (p1.X - p0.X);
        }

        /// <summary>
        /// Returns the right value of the point p with respect to the
        /// line from p0 to p1.
        /// </summary>
        public static double PosRightOfLineValue(this V2d p, V2d p0, V2d p1)
        {
            return (p.X - p0.X) * (p1.Y - p0.Y) + (p.Y - p0.Y) * (p0.X - p1.X);
        }

        #endregion

        #region Distance Functions

        /// <summary>
        /// Returns the minimal euclidean distance between the supplied query
        /// point and the line segment defined by the two supplied line end
        /// points.
        /// </summary>
        public static double DistanceToLine(
                this V2d query, V2d p0, V2d p1)
        {
            var p0p1 = p1 - p0;
            var p0q = query - p0;
            
            var t = V2d.Dot(p0q, p0p1);
            if (t <= 0) { return V2d.Distance(query, p0); }
            var denom = p0p1.LengthSquared;
            if (t >= denom) { return V2d.Distance(query, p1); }
            t /= denom;
            return V2d.Distance(query, p0 + t * p0p1);
        }

        /// <summary>
        /// Returns the minimal euclidean distance between the supplied query
        /// point and the infinite line defined by two points.
        /// </summary>
        public static double DistanceToInfiniteLine(
                this V2d query, V2d p0, V2d p1)
        {
            var p0p1 = p1 - p0;
            var p0q = query - p0;
            
            var t = V2d.Dot(p0q, p0p1);
            var denom = p0p1.LengthSquared;
            t /= denom;
            return V2d.Distance(query, p0 + t * p0p1);
        }

        /// <summary>
        /// Returns the minimal euclidean distance between the supplied query
        /// point and the line segment defined by the two supplied line end
        /// points.
        /// </summary>
        public static double DistanceToLine(
                this V2d query, V2d p0, V2d p1, out double t)
        {
            var p0p1 = p1 - p0;
            var p0q = query - p0;
            t = V2d.Dot(p0q, p0p1);
            if (t <= 0) { t = 0; return V2d.Distance(query, p0); }
            var denom = p0p1.LengthSquared;
            if (t >= denom) { t = 1; return V2d.Distance(query, p1); }
            t /= denom;
            return V2d.Distance(query, p0 + t * p0p1);
        }

        /// <summary>
        /// Returns the minimal euclidean distance between the supplied query
        /// point and the infinite line defined by two points.
        /// </summary>
        public static double DistanceToInfiniteLine(
                this V2d query, V2d p0, V2d p1, out double t)
        {
            var p0p1 = p1 - p0;
            var p0q = query - p0;
            t = V2d.Dot(p0q, p0p1);
            var denom = p0p1.LengthSquared;
            t /= denom;
            return V2d.Distance(query, p0 + t * p0p1);
        }

