        public static V2d LinCom(V2d p0, V2d p1, ref Tup2<double> w)
        {
            return p0 * w.E0 + p1 * w.E1;
        }

        public static V2d LinCom(V2d p0, V2d p1, V2d p2, ref Tup3<double> w)
        {
            return p0 * w.E0 + p1 * w.E1 + p2 * w.E2;
        }

        public static V2d LinCom(V2d p0, V2d p1, V2d p2, V2d p3, ref Tup4<double> w)
        {
            return p0 * w.E0 + p1 * w.E1 + p2 * w.E2 + p3 * w.E3;
        }

        public static V2d LinCom(V2d p0, V2d p1, V2d p2, V2d p3, V2d p4, ref Tup5<double> w)
        {
            return p0 * w.E0 + p1 * w.E1 + p2 * w.E2 + p3 * w.E3 + p4 * w.E4;
        }

        public static V2d LinCom(V2d p0, V2d p1, V2d p2, V2d p3, V2d p4, V2d p5, ref Tup6<double> w)
        {
            return p0 * w.E0 + p1 * w.E1 + p2 * w.E2 + p3 * w.E3 + p4 * w.E4 + p5 * w.E5;
        }

        public static V2d LinCom(V2d p0, V2d p1, V2d p2, V2d p3, V2d p4, V2d p5, V2d p6, ref Tup7<double> w)
        {
            return p0 * w.E0 + p1 * w.E1 + p2 * w.E2 + p3 * w.E3 + p4 * w.E4 + p5 * w.E5 + p6 * w.E6;
        }

