        public static int IndexOfClosestPoint(this V2d[] pointArray, V2d point)
        {
            var bestDist = V2d.DistanceSquared(point, pointArray[0]);
            int bestIndex = 0;
            int count = pointArray.Length;
            for (int i = 1; i < count; i++)
            {
                var dist = V2d.DistanceSquared(point, pointArray[i]);
                if (dist < bestDist) { bestDist = dist; bestIndex = i; }
            }
            return bestIndex;
        }

        public static int IndexOfClosestPoint(
                this V2d[] array, int start, int count,
                V2d point)
        {
            var bestDist = V2d.DistanceSquared(point, array[start]);
            int bestIndex = 0;
            for (int i = start + 1, e = start + count; i < e; i++)
            {
                var dist = V2d.DistanceSquared(point, array[i]);
                if (dist < bestDist) { bestDist = dist; bestIndex = i; }
            }
            return bestIndex;
        }

