        /// <summary>
        /// Returns the array of the index-th coordinate of each vector.
        /// </summary>
        public static double[] CopyCoord(this V2d[] self, int index)
        {
            switch (index)
            {
                case 0: return self.Map(v => v.X);
                case 1: return self.Map(v => v.Y);
                default: throw new IndexOutOfRangeException();
            }
        }

        public static V2d WeightedSum(
                this V2d[] vectorArray, double[] weightArray)
        {
            var r = V2d.Zero;
            var count = vectorArray.LongLength;
            for (long i = 0; i < count; i++) r += vectorArray[i] * weightArray[i];
            return r;
        }

