        /// Returns the squared distance between the given points.
        /// </summary>
        public static double DistanceSquared(V3i a, V3i b)
        {
            return 
                (b.X - a.X) * (b.X - a.X) + 
                (b.Y - a.Y) * (b.Y - a.Y) + 
                (b.Z - a.Z) * (b.Z - a.Z);
        }

