        /// <summary>
        /// Returns the componentwise minimum vector.
        /// </summary>
        public static V3i Min(V3i v0, V3i v1)
        {
            return new V3i(Fun.Min(v0.X, v1.X), Fun.Min(v0.Y, v1.Y), Fun.Min(v0.Z, v1.Z));
        }

        /// <summary>
        /// Returns the componentwise maximum vector.
        /// </summary>
        public static V3i Max(V3i v0, V3i v1)
        {
            return new V3i(Fun.Max(v0.X, v1.X), Fun.Max(v0.Y, v1.Y), Fun.Max(v0.Z, v1.Z));
        }

        /// <summary>
        /// Compare x-coordinate before y-coordinate, aso.
        /// </summary>
        public static int LexicalCompare(V3i v0, V3i v1)
        {
            if (v0.X < v1.X) return -1;
            if (v0.X > v1.X) return +1;
            if (v0.Y < v1.Y) return -1;
            if (v0.Y > v1.Y) return +1;
            if (v0.Z < v1.Z) return -1;
            if (v0.Z > v1.Z) return +1;
            return 0;
        }

        /// <summary>
        /// Compare x-coordinate before y-coordinate, aso.
        /// </summary>
        public int LexicalCompare(V3i v1)
        {
            if (X < v1.X) return -1;
            if (X > v1.X) return +1;
            if (Y < v1.Y) return -1;
            if (Y > v1.Y) return +1;
            if (Z < v1.Z) return -1;
            if (Z > v1.Z) return +1;
            return 0;
        }

