        #region IVector<double> Members

        /// <summary>
        /// By using long indices, the IVector&lt;double&gt; interface is
        /// accessed.
        /// </summary>
        public double this[long i]
        {
            get { return (double)this[(int)i]; }
            set { this[(int)i] = (int)value; }
        }

        #endregion

        #region ISize3d Members

        public V3d Size3d { get { return (V3d)this; } }

        #endregion

        #region IVector

        public long Dim
        {
            get { return 3; }
        }

        public object GetValue(long index)
        {
            return (object)this[(int)index];
        }

        public void SetValue(object value, long index)
        {
            this[(int)index] = (int)value;
        }

        #endregion

    }

    public class V3iEqualityComparer : IEqualityComparer<V3i>
    {
        public static readonly V3iEqualityComparer Default
            = new V3iEqualityComparer();

        #region IEqualityComparer<V3i> Members

        public bool Equals(V3i v0, V3i v1)
        {
            return v0 == v1;
        }

        public int GetHashCode(V3i v)
        {
            return v.GetHashCode();
        }

        #endregion
    }

