        public static int IndexOfClosestPoint(this V3i[] pointArray, V3i point)
        {
            var bestDist = V3i.DistanceSquared(point, pointArray[0]);
            int bestIndex = 0;
            int count = pointArray.Length;
            for (int i = 1; i < count; i++)
            {
                var dist = V3i.DistanceSquared(point, pointArray[i]);
                if (dist < bestDist) { bestDist = dist; bestIndex = i; }
            }
            return bestIndex;
        }

        public static int IndexOfClosestPoint(
                this V3i[] array, int start, int count,
                V3i point)
        {
            var bestDist = V3i.DistanceSquared(point, array[start]);
            int bestIndex = 0;
            for (int i = start + 1, e = start + count; i < e; i++)
            {
                var dist = V3i.DistanceSquared(point, array[i]);
                if (dist < bestDist) { bestDist = dist; bestIndex = i; }
            }
            return bestIndex;
        }

        public static int IndexOfClosestPoint<T>(
                this T[] array, int start, int count,
                Func<T, V3i> pointSelector, V3i point)
        {
            var bestDist = V3i.DistanceSquared(point, pointSelector(array[start]));
            int bestIndex = 0;
            for (int i = start + 1, e = start + count; i < e; i++)
            {
                var dist = V3i.DistanceSquared(point, pointSelector(array[i]));
                if (dist < bestDist) { bestDist = dist; bestIndex = i; }
            }
            return bestIndex;
        }

