        /// <summary>
        /// Returns the index of the element with the minimal X coordinate
        /// within the array.
        /// </summary>
        public static int IndexOfMinX(this V3i[] vectorArray, int count = 0)
        {
            var minimum = vectorArray[0].X;
            int minIndex = 0;
            if (count == 0) count = vectorArray.Length;
            for (int i = 1; i < count; i++)
            {
                var p = vectorArray[i].X;
                if (p < minimum) { minimum = p; minIndex = i; }
            }
            return minIndex;
        }

