    public class V3lEqualityComparer : IEqualityComparer<V3l>
    {
        public static readonly V3lEqualityComparer Default
            = new V3lEqualityComparer();

        #region IEqualityComparer<V3l> Members

        public bool Equals(V3l v0, V3l v1)
        {
