        public static int IndexOfClosestPoint(this V3l[] pointArray, V3l point)
        {
            var bestDist = V3l.DistanceSquared(point, pointArray[0]);
            int bestIndex = 0;
            int count = pointArray.Length;
            for (int i = 1; i < count; i++)
            {
                var dist = V3l.DistanceSquared(point, pointArray[i]);
                if (dist < bestDist) { bestDist = dist; bestIndex = i; }
            }
            return bestIndex;
        }

