        /// <summary>
        /// Returns an arbitrary normal vector, which
        /// is also normal to either the x, y or z-axis.
        /// </summary>
        public V3f AxisAlignedNormal()
        {
            V3f vector;
            float x = X.Abs();
            float y = Y.Abs();
            float z = Z.Abs();

            if (x < y)
            {
                if (x < z)
                    vector = V3f.XAxis;
                else
                    vector = V3f.ZAxis;
            }
            else
            {
                if (y < z)
                    vector = V3f.YAxis;
                else
                    vector = V3f.ZAxis;
            }

            return Cross(vector).Normalized;
        }

