        public V3f Normalized
        {
            get
            {
                var s = Length; if (s == 0) return V3f.Zero;
                s = 1 / s;
                return new V3f(X * s, Y * s, Z * s);
            }
        }

        /// <summary>
        /// Returns a copy of the vector with the maximum component length of
        /// exactly 1. This corresponds to mapping the vector onto an origin-
        /// centered cube with side length 2.
        /// </summary>
        public V3f CubeMapped
        {
            get
            {
                float x = Fun.Abs(X);
                float y = Fun.Abs(Y);
                float z = Fun.Abs(Z);
                if (x > y)
                {
                    if (x > z)
                    {
                        double s = 1 / x;
                        return new V3f(Fun.Sign(X), Y * s, Z * s);
                    }
                    else
                    {
                        double s = 1 / z;
                        return new V3f(X * s, Y * s, Fun.Sign(Z));
                    }
                }
                else
                {
                    if (y > z)
                    {
                        double s = 1 / y;
                        return new V3f(X * s, Fun.Sign(Y), Z * s);
                    }
                    else
                    {
                        double s = 1 / z;
                        return new V3f(X * s, Y * s, Fun.Sign(Z));
                    }
                }
            }
        }

        /// <summary>
        /// Returns a copy of the vector with the maximum component length of
        /// exactly 1. This corresponds to mapping the vector onto an origin-
        /// centered cube with side length 2.
        /// The out parameter face indicate which face the vector was mapped to:
        /// 0 ... -XAxis, 1 ... -YAxis, 2 ... -ZAsix, 3 ... XAxis, 4 ... YAxis, 5 ... ZAxis.
        /// </summary>
        public V3f CubeMappedOnFace(out int face)
        {
                float x = Fun.Abs(X);
                float y = Fun.Abs(Y);
                float z = Fun.Abs(Z);
                if (x > y)
                {
                    if (x > z)
                    {
                        double s = 1 / x; face = X < 0 ? 0 : 3;
                        return new V3f(Fun.Sign(X), Y * s, Z * s);
                    }
                    else
                    {
                        double s = 1 / z; face = Z < 0 ? 2 : 5;
                        return new V3f(X * s, Y * s, Fun.Sign(Z));
                    }
                }
                else
                {
                    if (y > z)
                    {
                        double s = 1 / y; face = Y < 0 ? 1 : 4;
                        return new V3f(X * s, Fun.Sign(Y), Z * s);
                    }
                    else
                    {
                        double s = 1 / z; face = Z < 0 ? 2 : 5;
                        return new V3f(X * s, Y * s, Fun.Sign(Z));
                    }
                }
        }

        private static readonly V3f[] s_fromCubeCode =
            new V3f[] { -V3f.XAxis, -V3f.YAxis, -V3f.ZAxis,
                        V3f.XAxis, V3f.YAxis, V3f.ZAxis };

        /// <summary>
        /// Return the vector for the supplied cube face code.
        /// 0 ... -XAxis, 1 ... -YAxis, 2 ... -ZAsix, 3 ... XAxis, 4 ... YAxis, 5 ... ZAxis.
        /// </summary>
        public static V3f FromCubeFaceCode(int i) { return s_fromCubeCode[i]; }

        /// <summary>
        /// Return an index for the cube face onto which the vector points.
        /// 0 ... -XAxis, 1 ... -YAxis, 2 ... -ZAsix, 3 ... XAxis, 4 ... YAxis, 5 ... ZAxis.
        /// </summary>
        public int CubeFaceCode
        {
            get
            {
                double x = System.Math.Abs(X);
                double y = System.Math.Abs(Y);
                double z = System.Math.Abs(Z);
                int c;
                double v;
                if (x > y)
                {
                    if (x > z) { c = 0; v = X; } else { c = 2; v = Z; }
                }
                else
                {
                    if (y > z) { c = 1; v = Y; } else { c = 2; v = Z; }
                }
                return v < 0 ? c : c + 3;
            }
        }

