        }

        /// <summary>
        /// Compare x-coordinate before y-coordinate, aso.
        /// </summary>
        public static int LexicalCompare(V3f v0, V3f v1)
        {
            if (v0.X < v1.X) return -1;
            if (v0.X > v1.X) return +1;
            if (v0.Y < v1.Y) return -1;
            if (v0.Y > v1.Y) return +1;
            if (v0.Z < v1.Z) return -1;
            if (v0.Z > v1.Z) return +1;
            return 0;
        }

        /// <summary>
        /// Compare x-coordinate before y-coordinate, aso.
        /// </summary>
        public int LexicalCompare(V3f v1)
        {
            if (X < v1.X) return -1;
            if (X > v1.X) return +1;
            if (Y < v1.Y) return -1;
            if (Y > v1.Y) return +1;
            if (Z < v1.Z) return -1;
            if (Z > v1.Z) return +1;
            return 0;
        }

