    public class V3fEqualityComparer : IEqualityComparer<V3f>
    {
        public static readonly V3fEqualityComparer Default
            = new V3fEqualityComparer();

        #region IEqualityComparer<V3f> Members

        public bool Equals(V3f v0, V3f v1)
        {
            return v0 == v1;
        }

        public int GetHashCode(V3f v)
        {
            return v.GetHashCode();
        }

        #endregion
    }

    /// <summary>
    /// This static class for extension functions for V3f has a non-
    /// standard name ending in "Fun" in order to shorten the function name
    /// when used as function parameters.
    /// </summary>
    public static partial class VecFun
    {
        #region Distance Functions

        /// <summary>
        /// Returns the minimal euclidean distance between the supplied query
        /// point and the line segment defined by the two supplied line end
        /// points.
        /// </summary>
        public static float DistanceToLine(
                this V3f query, V3f p0, V3f p1)
        {
            var p0p1 = p1 - p0;
            var p0q = query - p0;
            
            var t = V3f.Dot(p0q, p0p1);
            if (t <= 0) { return V3f.Distance(query, p0); }
            var denom = p0p1.LengthSquared;
            if (t >= denom) { return V3f.Distance(query, p1); }
            t /= denom;
            return V3f.Distance(query, p0 + t * p0p1);
        }

        /// <summary>
        /// Returns the minimal euclidean distance between the supplied query
        /// point and the infinite line defined by two points.
        /// </summary>
        public static float DistanceToInfiniteLine(
                this V3f query, V3f p0, V3f p1)
        {
            var p0p1 = p1 - p0;
            var p0q = query - p0;
            
            var t = V3f.Dot(p0q, p0p1);
            var denom = p0p1.LengthSquared;
            t /= denom;
            return V3f.Distance(query, p0 + t * p0p1);
        }

        /// <summary>
        /// Returns the minimal euclidean distance between the supplied query
        /// point and the line segment defined by the two supplied line end
        /// points.
        /// </summary>
        public static float DistanceToLine(
                this V3f query, V3f p0, V3f p1, out float t)
        {
            var p0p1 = p1 - p0;
            var p0q = query - p0;
            t = V3f.Dot(p0q, p0p1);
            if (t <= 0) { t = 0; return V3f.Distance(query, p0); }
            var denom = p0p1.LengthSquared;
            if (t >= denom) { t = 1; return V3f.Distance(query, p1); }
            t /= denom;
            return V3f.Distance(query, p0 + t * p0p1);
        }

        /// <summary>
        /// Returns the minimal euclidean distance between the supplied query
        /// point and the infinite line defined by two points.
        /// </summary>
        public static float DistanceToInfiniteLine(
                this V3f query, V3f p0, V3f p1, out float t)
        {
            var p0p1 = p1 - p0;
            var p0q = query - p0;
            t = V3f.Dot(p0q, p0p1);
            var denom = p0p1.LengthSquared;
            t /= denom;
            return V3f.Distance(query, p0 + t * p0p1);
        }

