        /// <summary>
        /// Returns an arbitrary normal vector, which
        /// is also normal to either the x, y or z-axis.
        /// </summary>
        public V3d AxisAlignedNormal()
        {
            V3d vector;
            double x = X.Abs();
            double y = Y.Abs();
            double z = Z.Abs();

            if (x < y)
            {
                if (x < z)
                    vector = V3d.XAxis;
                else
                    vector = V3d.ZAxis;
            }
            else
            {
                if (y < z)
                    vector = V3d.YAxis;
                else
                    vector = V3d.ZAxis;
            }

            return Cross(vector).Normalized;
        }

