        /// <summary>
        /// Returns the squared distance between the given points.
        /// </summary>
        public static double DistanceSquared(V3d a, V3d b)
        {
            return 
                (b.X - a.X) * (b.X - a.X) + 
                (b.Y - a.Y) * (b.Y - a.Y) + 
                (b.Z - a.Z) * (b.Z - a.Z);
        }

        /// <summary>
        /// Returns the distance between the given points.
        /// </summary>
        public static double Distance(V3d a, V3d b)
        {
            return Fun.Sqrt(
                        (b.X - a.X) * (b.X - a.X) + 
                        (b.Y - a.Y) * (b.Y - a.Y) + 
                        (b.Z - a.Z) * (b.Z - a.Z));
        }

        /// <summary>
        /// Returns the Manhatten (or 1-) distance between two vectors.
        /// </summary>
        public static double Distance1(V3d a, V3d b)
        {
            return 
                Fun.Abs(b.X - a.X) + 
                Fun.Abs(b.Y - a.Y) + 
                Fun.Abs(b.Z - a.Z);
        }

