        /// <summary>
        /// Returns a copy of the vector with the maximum component length of
        /// exactly 1. This corresponds to mapping the vector onto an origin-
        /// centered cube with side length 2.
        /// </summary>
        public V3d CubeMapped
        {
            get
            {
                double x = Fun.Abs(X);
                double y = Fun.Abs(Y);
                double z = Fun.Abs(Z);
                if (x > y)
                {
                    if (x > z)
                    {
                        double s = 1 / x;
                        return new V3d(Fun.Sign(X), Y * s, Z * s);
                    }
                    else
                    {
                        double s = 1 / z;
                        return new V3d(X * s, Y * s, Fun.Sign(Z));
                    }
                }
                else
                {
                    if (y > z)
                    {
                        double s = 1 / y;
                        return new V3d(X * s, Fun.Sign(Y), Z * s);
                    }
                    else
                    {
                        double s = 1 / z;
                        return new V3d(X * s, Y * s, Fun.Sign(Z));
                    }
                }
            }
        }

        /// <summary>
        /// Returns a copy of the vector with the maximum component length of
        /// exactly 1. This corresponds to mapping the vector onto an origin-
        /// centered cube with side length 2.
        /// The out parameter face indicate which face the vector was mapped to:
        /// 0 ... -XAxis, 1 ... -YAxis, 2 ... -ZAsix, 3 ... XAxis, 4 ... YAxis, 5 ... ZAxis.
        /// </summary>
        public V3d CubeMappedOnFace(out int face)
        {
                double x = Fun.Abs(X);
                double y = Fun.Abs(Y);
                double z = Fun.Abs(Z);
                if (x > y)
                {
                    if (x > z)
                    {
                        double s = 1 / x; face = X < 0 ? 0 : 3;
                        return new V3d(Fun.Sign(X), Y * s, Z * s);
                    }
                    else
                    {
                        double s = 1 / z; face = Z < 0 ? 2 : 5;
                        return new V3d(X * s, Y * s, Fun.Sign(Z));
                    }
                }
                else
                {
                    if (y > z)
                    {
                        double s = 1 / y; face = Y < 0 ? 1 : 4;
                        return new V3d(X * s, Fun.Sign(Y), Z * s);
                    }
                    else
                    {
                        double s = 1 / z; face = Z < 0 ? 2 : 5;
                        return new V3d(X * s, Y * s, Fun.Sign(Z));
                    }
                }
        }

