        #region Distance Functions

        /// <summary>
        /// Returns the minimal euclidean distance between the supplied query
        /// point and the line segment defined by the two supplied line end
        /// points.
        /// </summary>
        public static double DistanceToLine(
                this V3d query, V3d p0, V3d p1)
        {
            var p0p1 = p1 - p0;
            var p0q = query - p0;
            
            var t = V3d.Dot(p0q, p0p1);
            if (t <= 0) { return V3d.Distance(query, p0); }
            var denom = p0p1.LengthSquared;
            if (t >= denom) { return V3d.Distance(query, p1); }
            t /= denom;
            return V3d.Distance(query, p0 + t * p0p1);
        }

        /// <summary>
        /// Returns the minimal euclidean distance between the supplied query
        /// point and the infinite line defined by two points.
        /// </summary>
        public static double DistanceToInfiniteLine(
                this V3d query, V3d p0, V3d p1)
        {
            var p0p1 = p1 - p0;
            var p0q = query - p0;
            
            var t = V3d.Dot(p0q, p0p1);
            var denom = p0p1.LengthSquared;
            t /= denom;
            return V3d.Distance(query, p0 + t * p0p1);
        }

        /// <summary>
        /// Returns the minimal euclidean distance between the supplied query
        /// point and the line segment defined by the two supplied line end
        /// points.
        /// </summary>
        public static double DistanceToLine(
                this V3d query, V3d p0, V3d p1, out double t)
        {
            var p0p1 = p1 - p0;
            var p0q = query - p0;
            t = V3d.Dot(p0q, p0p1);
            if (t <= 0) { t = 0; return V3d.Distance(query, p0); }
            var denom = p0p1.LengthSquared;
            if (t >= denom) { t = 1; return V3d.Distance(query, p1); }
            t /= denom;
            return V3d.Distance(query, p0 + t * p0p1);
        }

        /// <summary>
        /// Returns the minimal euclidean distance between the supplied query
        /// point and the infinite line defined by two points.
        /// </summary>
        public static double DistanceToInfiniteLine(
                this V3d query, V3d p0, V3d p1, out double t)
        {
            var p0p1 = p1 - p0;
            var p0q = query - p0;
            t = V3d.Dot(p0q, p0p1);
            var denom = p0p1.LengthSquared;
            t /= denom;
            return V3d.Distance(query, p0 + t * p0p1);
        }

