        public static int IndexOfClosestPoint(this V3d[] pointArray, V3d point)
        {
            var bestDist = V3d.DistanceSquared(point, pointArray[0]);
            int bestIndex = 0;
            int count = pointArray.Length;
            for (int i = 1; i < count; i++)
            {
                var dist = V3d.DistanceSquared(point, pointArray[i]);
                if (dist < bestDist) { bestDist = dist; bestIndex = i; }
            }
            return bestIndex;
        }

        public static int IndexOfClosestPoint(
                this V3d[] array, int start, int count,
                V3d point)
        {
            var bestDist = V3d.DistanceSquared(point, array[start]);
            int bestIndex = 0;
            for (int i = start + 1, e = start + count; i < e; i++)
            {
                var dist = V3d.DistanceSquared(point, array[i]);
                if (dist < bestDist) { bestDist = dist; bestIndex = i; }
            }
            return bestIndex;
        }

