        }
        
        /// <summary>
        /// Returns the Manhattan (or 1-) norm of the vector. This is
        /// calculated as |x| + |y| + ...
        /// </summary>
        public int Norm1
        {
            get { return Fun.Abs(X) + Fun.Abs(Y) + Fun.Abs(Z) + Fun.Abs(W); }
        }

        /// <summary>
        /// Returns the Euclidean (or 2-) norm of the vector. This is the
        /// length of the vector.
        /// </summary>
        public double Norm2
        {
            get { return Fun.Sqrt(X * X + Y * Y + Z * Z + W * W); }
        }

        /// <summary>
        /// Returns the infinite (or maximum) norm of the vector. This is
        /// calculated as max(|x|, |y|, ...).
        /// </summary>
        public int NormMax
        {
            get { return Fun.Max(Fun.Abs(X), Fun.Abs(Y), Fun.Abs(Z), Fun.Abs(W)); }
        }

        /// <summary>
