            if (Y > 0) flags |= Vec.DirFlags.PositiveY;
            if (Y < 0) flags |= Vec.DirFlags.NegativeY;
            if (Z > 0) flags |= Vec.DirFlags.PositiveZ;
            if (Z < 0) flags |= Vec.DirFlags.NegativeZ;
            if (W > 0) flags |= Vec.DirFlags.PositiveW;
            if (W < 0) flags |= Vec.DirFlags.NegativeW;
            return flags;
