        public static int IndexOfClosestPoint(this V4i[] pointArray, V4i point)
        {
            var bestDist = V4i.DistanceSquared(point, pointArray[0]);
            int bestIndex = 0;
            int count = pointArray.Length;
            for (int i = 1; i < count; i++)
            {
                var dist = V4i.DistanceSquared(point, pointArray[i]);
                if (dist < bestDist) { bestDist = dist; bestIndex = i; }
            }
            return bestIndex;
        }

        public static int IndexOfClosestPoint(
                this V4i[] array, int start, int count,
                V4i point)
        {
            var bestDist = V4i.DistanceSquared(point, array[start]);
            int bestIndex = 0;
            for (int i = start + 1, e = start + count; i < e; i++)
            {
                var dist = V4i.DistanceSquared(point, array[i]);
                if (dist < bestDist) { bestDist = dist; bestIndex = i; }
            }
            return bestIndex;
        }

