        /// Gets the p-norm. This is calculated as the p-th root of (|x|^n + |y|^n + ...).
        /// </summary>
        public double Norm(double p)
        {
            return (
                Fun.Abs(X).Pow(p) + 
                Fun.Abs(Y).Pow(p) + 
                Fun.Abs(Z).Pow(p) + 
                Fun.Abs(W).Pow(p)).Pow(1 / p);
        }

        /// <summary>
        /// Returns the squared distance between the given points.
        /// </summary>
        public static double DistanceSquared(V4l a, V4l b)
        {
            return 
                (b.X - a.X) * (b.X - a.X) + 
                (b.Y - a.Y) * (b.Y - a.Y) + 
                (b.Z - a.Z) * (b.Z - a.Z) + 
                (b.W - a.W) * (b.W - a.W);
        }

        /// <summary>
        /// Returns the distance between the given points.
        /// </summary>
        public static double Distance(V4l a, V4l b)
        {
            return Fun.Sqrt(
                        (b.X - a.X) * (b.X - a.X) + 
                        (b.Y - a.Y) * (b.Y - a.Y) + 
                        (b.Z - a.Z) * (b.Z - a.Z) + 
                        (b.W - a.W) * (b.W - a.W));
        }

        /// <summary>
        /// Returns the Manhatten (or 1-) distance between two vectors.
        /// </summary>
        public static double Distance1(V4l a, V4l b)
        {
            return 
                Fun.Abs(b.X - a.X) + 
                Fun.Abs(b.Y - a.Y) + 
                Fun.Abs(b.Z - a.Z) + 
                Fun.Abs(b.W - a.W);
        }

        /// <summary>
        /// Returns the p-distance between two vectors.
        /// </summary>
        public static double Distance(V4l a, V4l b, double p)
        {
            return (
                        Fun.Abs(b.X - a.X).Pow(p) + 
                        Fun.Abs(b.Y - a.Y).Pow(p) + 
                        Fun.Abs(b.Z - a.Z).Pow(p) + 
                        Fun.Abs(b.W - a.W).Pow(p)).Pow(1 / p);
        }

        /// <summary>
        /// Returns the maximal absolute distance between the components of
        /// the two vectors.
        /// </summary>
        public static long DistanceMax(V4l a, V4l b)
        {
            return Fun.Max(
                        Fun.Abs(b.X - a.X), 
                        Fun.Abs(b.Y - a.Y), 
                        Fun.Abs(b.Z - a.Z), 
                        Fun.Abs(b.W - a.W));
        }

        /// <summary>
