        /// the two vectors.
        /// </summary>
        public static long DistanceMin(V4l a, V4l b)
        {
            return Fun.Min(
                        Fun.Abs(b.X - a.X), 
                        Fun.Abs(b.Y - a.Y), 
                        Fun.Abs(b.Z - a.Z), 
