        public Vec.DirFlags DirFlags()
        {
            Vec.DirFlags flags = Vec.DirFlags.None;
            if (X > Constant<float>.PositiveTinyValue) flags |= Vec.DirFlags.PositiveX;
            if (X < Constant<float>.NegativeTinyValue) flags |= Vec.DirFlags.NegativeX;
            if (Y > Constant<float>.PositiveTinyValue) flags |= Vec.DirFlags.PositiveY;
            if (Y < Constant<float>.NegativeTinyValue) flags |= Vec.DirFlags.NegativeY;
            if (Z > Constant<float>.PositiveTinyValue) flags |= Vec.DirFlags.PositiveZ;
            if (Z < Constant<float>.NegativeTinyValue) flags |= Vec.DirFlags.NegativeZ;
            if (W > Constant<float>.PositiveTinyValue) flags |= Vec.DirFlags.PositiveW;
            if (W < Constant<float>.NegativeTinyValue) flags |= Vec.DirFlags.NegativeW;
            return flags;
        }

