        /// <summary>
        /// Compare x-coordinate before y-coordinate, aso.
        /// </summary>
        public static int LexicalCompare(V4f v0, V4f v1)
        {
            if (v0.X < v1.X) return -1;
            if (v0.X > v1.X) return +1;
            if (v0.Y < v1.Y) return -1;
            if (v0.Y > v1.Y) return +1;
            if (v0.Z < v1.Z) return -1;
            if (v0.Z > v1.Z) return +1;
            if (v0.W < v1.W) return -1;
            if (v0.W > v1.W) return +1;
            return 0;
        }

        /// <summary>
        /// Compare x-coordinate before y-coordinate, aso.
        /// </summary>
        public int LexicalCompare(V4f v1)
        {
            if (X < v1.X) return -1;
            if (X > v1.X) return +1;
            if (Y < v1.Y) return -1;
            if (Y > v1.Y) return +1;
            if (Z < v1.Z) return -1;
            if (Z > v1.Z) return +1;
            if (W < v1.W) return -1;
            if (W > v1.W) return +1;
            return 0;
        }

        #endregion

        #region IEquatable<V4f> Members

        public bool Equals(V4f other)
        {
            return X == other.X && Y == other.Y && Z == other.Z && W == other.W;
        }

        #endregion

        #region Overrides

        public override string ToString()
        {
            return ToString(null, Localization.FormatEnUS);
        }
        
        public string ToString(string format)
        {
            return ToString(format, Localization.FormatEnUS);
        }

        public string ToString(string format, IFormatProvider fp)
        {
            return ToString(format, fp, "[", ", ", "]");
        }

        /// <summary>
        /// Outputs e.g. a 3D-Vector in the form "(begin)x(between)y(between)z(end)".
        /// </summary>
        public string ToString(string format, IFormatProvider fp, string begin, string between, string end)
        {
            if (fp == null) fp = Localization.FormatEnUS;
            return begin + X.ToString(format, fp)  + between + Y.ToString(format, fp)  + between + Z.ToString(format, fp)  + between + W.ToString(format, fp)  + end;
        }

        public override int GetHashCode()
        {
            return HashCode.GetCombined(X, Y, Z, W); 
        }
        
        public override bool Equals(object other)
        {
            return (other is V4f) ? this == (V4f)other : false;
        }

        public Text ToText(int bracketLevel = 1)
        {
            return
                ((bracketLevel == 1 ? "[" : "")
                + X.ToString(null, Localization.FormatEnUS)  + ", " 
                + Y.ToString(null, Localization.FormatEnUS)  + ", " 
                + Z.ToString(null, Localization.FormatEnUS)  + ", " 
                + W.ToString(null, Localization.FormatEnUS) 
                + (bracketLevel == 1 ? "]" : "")).ToText();
        }

        #endregion

        #region Parsing

        public static V4f Parse(string s)
        {
            var x = s.NestedBracketSplitLevelOne().ToArray();
            return new V4f(
                float.Parse(x[0], Localization.FormatEnUS), 
                float.Parse(x[1], Localization.FormatEnUS), 
                float.Parse(x[2], Localization.FormatEnUS), 
                float.Parse(x[3], Localization.FormatEnUS)
            );
        }

        public static V4f Parse(Text t)
        {
            return t.NestedBracketSplit(1, Text<float>.Parse, V4f.Setter);
        }

        public static V4f Parse(Text t, int bracketLevel)
        {
            return t.NestedBracketSplit(bracketLevel, Text<float>.Parse, V4f.Setter);
        }

        #endregion

