    /// <summary>
    /// This static class for extension functions for V4f has a non-
    /// standard name ending in "Fun" in order to shorten the function name
    /// when used as function parameters.
    /// </summary>
    public static partial class VecFun
    {
        #region Distance Functions

        /// <summary>
        /// Returns the minimal euclidean distance between the supplied query
        /// point and the line segment defined by the two supplied line end
        /// points.
        /// </summary>
        public static float DistanceToLine(
                this V4f query, V4f p0, V4f p1)
        {
            var p0p1 = p1 - p0;
            var p0q = query - p0;
            
            var t = V4f.Dot(p0q, p0p1);
            if (t <= 0) { return V4f.Distance(query, p0); }
            var denom = p0p1.LengthSquared;
            if (t >= denom) { return V4f.Distance(query, p1); }
            t /= denom;
            return V4f.Distance(query, p0 + t * p0p1);
        }

        /// <summary>
        /// Returns the minimal euclidean distance between the supplied query
        /// point and the infinite line defined by two points.
        /// </summary>
        public static float DistanceToInfiniteLine(
                this V4f query, V4f p0, V4f p1)
        {
            var p0p1 = p1 - p0;
            var p0q = query - p0;
            
            var t = V4f.Dot(p0q, p0p1);
            var denom = p0p1.LengthSquared;
            t /= denom;
            return V4f.Distance(query, p0 + t * p0p1);
        }

        /// <summary>
        /// Returns the minimal euclidean distance between the supplied query
        /// point and the line segment defined by the two supplied line end
        /// points.
        /// </summary>
        public static float DistanceToLine(
                this V4f query, V4f p0, V4f p1, out float t)
        {
            var p0p1 = p1 - p0;
            var p0q = query - p0;
            t = V4f.Dot(p0q, p0p1);
            if (t <= 0) { t = 0; return V4f.Distance(query, p0); }
            var denom = p0p1.LengthSquared;
            if (t >= denom) { t = 1; return V4f.Distance(query, p1); }
            t /= denom;
            return V4f.Distance(query, p0 + t * p0p1);
        }

        /// <summary>
        /// Returns the minimal euclidean distance between the supplied query
        /// point and the infinite line defined by two points.
        /// </summary>
        public static float DistanceToInfiniteLine(
                this V4f query, V4f p0, V4f p1, out float t)
        {
            var p0p1 = p1 - p0;
            var p0q = query - p0;
            t = V4f.Dot(p0q, p0p1);
            var denom = p0p1.LengthSquared;
            t /= denom;
            return V4f.Distance(query, p0 + t * p0p1);
        }

