        public static V4f Lerp(this float t, V4f a, V4f b)
        { return a + (b - a) * t; }

        /// <summary>
        /// Returns the linearly interpolated vector between a and b.
        /// </summary>
        public static V4f Lerp(this double t, V4f a, V4f b)
        { return a + (b - a) * (float)t; }

