        #region ArrayExtensions

        public static int IndexOfClosestPoint(this V4f[] pointArray, V4f point)
        {
            var bestDist = V4f.DistanceSquared(point, pointArray[0]);
            int bestIndex = 0;
            int count = pointArray.Length;
            for (int i = 1; i < count; i++)
            {
                var dist = V4f.DistanceSquared(point, pointArray[i]);
                if (dist < bestDist) { bestDist = dist; bestIndex = i; }
            }
            return bestIndex;
        }

        public static int IndexOfClosestPoint(
                this V4f[] array, int start, int count,
                V4f point)
        {
            var bestDist = V4f.DistanceSquared(point, array[start]);
            int bestIndex = 0;
            for (int i = start + 1, e = start + count; i < e; i++)
            {
                var dist = V4f.DistanceSquared(point, array[i]);
                if (dist < bestDist) { bestDist = dist; bestIndex = i; }
            }
            return bestIndex;
        }

        public static int IndexOfClosestPoint<T>(
                this T[] array, int start, int count,
                Func<T, V4f> pointSelector, V4f point)
        {
            var bestDist = V4f.DistanceSquared(point, pointSelector(array[start]));
            int bestIndex = 0;
            for (int i = start + 1, e = start + count; i < e; i++)
            {
                var dist = V4f.DistanceSquared(point, pointSelector(array[i]));
                if (dist < bestDist) { bestDist = dist; bestIndex = i; }
            }
            return bestIndex;
        }

