        }

        /// <summary>
        /// Gets the p-norm. This is calculated as the p-th root of (|x|^n + |y|^n + ...).
        /// </summary>
        public double Norm(double p)
        {
            return (
                Fun.Abs(X).Pow(p) + 
                Fun.Abs(Y).Pow(p) + 
                Fun.Abs(Z).Pow(p) + 
                Fun.Abs(W).Pow(p)).Pow(1 / p);
        }

        /// <summary>
        /// Returns the squared distance between the given points.
        /// </summary>
        public static double DistanceSquared(V4d a, V4d b)
        {
            return 
                (b.X - a.X) * (b.X - a.X) + 
                (b.Y - a.Y) * (b.Y - a.Y) + 
                (b.Z - a.Z) * (b.Z - a.Z) + 
                (b.W - a.W) * (b.W - a.W);
        }

        /// <summary>
        /// Returns the distance between the given points.
        /// </summary>
        public static double Distance(V4d a, V4d b)
        {
            return Fun.Sqrt(
                        (b.X - a.X) * (b.X - a.X) + 
                        (b.Y - a.Y) * (b.Y - a.Y) + 
                        (b.Z - a.Z) * (b.Z - a.Z) + 
                        (b.W - a.W) * (b.W - a.W));
        }

        /// <summary>
        /// Returns the Manhatten (or 1-) distance between two vectors.
        /// </summary>
        public static double Distance1(V4d a, V4d b)
        {
            return 
                Fun.Abs(b.X - a.X) + 
                Fun.Abs(b.Y - a.Y) + 
                Fun.Abs(b.Z - a.Z) + 
                Fun.Abs(b.W - a.W);
        }

        /// <summary>
        /// Returns the p-distance between two vectors.
        /// </summary>
        public static double Distance(V4d a, V4d b, double p)
        {
            return (
                        Fun.Abs(b.X - a.X).Pow(p) + 
                        Fun.Abs(b.Y - a.Y).Pow(p) + 
                        Fun.Abs(b.Z - a.Z).Pow(p) + 
                        Fun.Abs(b.W - a.W).Pow(p)).Pow(1 / p);
        }

        /// <summary>
        /// Returns the maximal absolute distance between the components of
        /// the two vectors.
        /// </summary>
        public static double DistanceMax(V4d a, V4d b)
        {
            return Fun.Max(
                        Fun.Abs(b.X - a.X), 
                        Fun.Abs(b.Y - a.Y), 
                        Fun.Abs(b.Z - a.Z), 
                        Fun.Abs(b.W - a.W));
        }

        /// <summary>
        /// Returns the minimal absolute distance between the components of
        /// the two vectors.
        /// </summary>
        public static double DistanceMin(V4d a, V4d b)
        {
            return Fun.Min(
                        Fun.Abs(b.X - a.X), 
                        Fun.Abs(b.Y - a.Y), 
                        Fun.Abs(b.Z - a.Z), 
                        Fun.Abs(b.W - a.W));
        }

        /// <summary>
        /// Normalizes the vector.
        /// </summary>
        public void Normalize()
        {
            var s = Length; if (s == 0) return;
            s = 1 / s;
            X *= s; Y *= s; Z *= s; W *= s; 
        }

        /// <summary>
        /// Returns a normalized copy of this vector.
        /// </summary>
        public V4d Normalized
        {
            get
            {
                var s = Length; if (s == 0) return V4d.Zero;
                s = 1 / s;
                return new V4d(X * s, Y * s, Z * s, W * s);
            }
        }

        /// <summary>
        /// Returns a copy of the vector with the maximum component length of
        /// exactly 1. This corresponds to mapping the vector onto an origin-
        /// centered cube with side length 2.
        /// </summary>
        public V4d CubeMapped
        {
            get
            {
                var s = 1 / Fun.Max(Fun.Abs(X), Fun.Abs(Y), Fun.Abs(Z), Fun.Abs(W));
                return new V4d(X * s, Y * s, Z * s, W * s);
            }
        }

