        }

        /// <summary>
        /// Compare x-coordinate before y-coordinate, aso.
        /// </summary>
        public static int LexicalCompare(V4d v0, V4d v1)
        {
            if (v0.X < v1.X) return -1;
            if (v0.X > v1.X) return +1;
            if (v0.Y < v1.Y) return -1;
            if (v0.Y > v1.Y) return +1;
            if (v0.Z < v1.Z) return -1;
            if (v0.Z > v1.Z) return +1;
            if (v0.W < v1.W) return -1;
            if (v0.W > v1.W) return +1;
            return 0;
        }

        /// <summary>
        /// Compare x-coordinate before y-coordinate, aso.
        /// </summary>
        public int LexicalCompare(V4d v1)
        {
            if (X < v1.X) return -1;
            if (X > v1.X) return +1;
            if (Y < v1.Y) return -1;
            if (Y > v1.Y) return +1;
            if (Z < v1.Z) return -1;
            if (Z > v1.Z) return +1;
            if (W < v1.W) return -1;
            if (W > v1.W) return +1;
            return 0;
        }

