    /// <summary>
    /// This static class for extension functions for V4d has a non-
    /// standard name ending in "Fun" in order to shorten the function name
    /// when used as function parameters.
    /// </summary>
    public static partial class VecFun
    {
        #region Distance Functions

        /// <summary>
        /// Returns the minimal euclidean distance between the supplied query
        /// point and the line segment defined by the two supplied line end
        /// points.
        /// </summary>
        public static double DistanceToLine(
                this V4d query, V4d p0, V4d p1)
        {
            var p0p1 = p1 - p0;
            var p0q = query - p0;
            
            var t = V4d.Dot(p0q, p0p1);
            if (t <= 0) { return V4d.Distance(query, p0); }
            var denom = p0p1.LengthSquared;
            if (t >= denom) { return V4d.Distance(query, p1); }
            t /= denom;
            return V4d.Distance(query, p0 + t * p0p1);
        }

        /// <summary>
        /// Returns the minimal euclidean distance between the supplied query
        /// point and the infinite line defined by two points.
        /// </summary>
        public static double DistanceToInfiniteLine(
                this V4d query, V4d p0, V4d p1)
        {
            var p0p1 = p1 - p0;
            var p0q = query - p0;
            
            var t = V4d.Dot(p0q, p0p1);
            var denom = p0p1.LengthSquared;
            t /= denom;
            return V4d.Distance(query, p0 + t * p0p1);
        }

        /// <summary>
        /// Returns the minimal euclidean distance between the supplied query
        /// point and the line segment defined by the two supplied line end
        /// points.
        /// </summary>
        public static double DistanceToLine(
                this V4d query, V4d p0, V4d p1, out double t)
        {
            var p0p1 = p1 - p0;
            var p0q = query - p0;
            t = V4d.Dot(p0q, p0p1);
            if (t <= 0) { t = 0; return V4d.Distance(query, p0); }
            var denom = p0p1.LengthSquared;
            if (t >= denom) { t = 1; return V4d.Distance(query, p1); }
            t /= denom;
            return V4d.Distance(query, p0 + t * p0p1);
        }

        /// <summary>
        /// Returns the minimal euclidean distance between the supplied query
        /// point and the infinite line defined by two points.
        /// </summary>
        public static double DistanceToInfiniteLine(
                this V4d query, V4d p0, V4d p1, out double t)
        {
            var p0p1 = p1 - p0;
            var p0q = query - p0;
            t = V4d.Dot(p0q, p0p1);
            var denom = p0p1.LengthSquared;
            t /= denom;
            return V4d.Distance(query, p0 + t * p0p1);
        }

