            var minimum = vectorArray[0].Z;
            int minIndex = 0;
            if (count == 0) count = vectorArray.Count;
            for (int i = 1; i < count; i++)
            {
                var p = vectorArray[i].Z;
                if (p < minimum) { minimum = p; minIndex = i; }
            }
            return minIndex;
        }

        /// <summary>
        /// Returns the index of the element with the maximal Z coordinate
        /// within the list.
        /// </summary>
        public static int IndexOfMaxZ(this IList<V4d> vectorArray, int count = 0)
        {
            var maximum = vectorArray[0].Z;
            int maxIndex = 0;
            if (count == 0) count = vectorArray.Count;
            for (int i = 1; i < count; i++)
            {
                var p = vectorArray[i].Z;
                if (p > maximum) { maximum = p; maxIndex = i; }
            }
            return maxIndex;
        }

